<style lang="scss">
  @import "~/styles/variables.scss";

  .navigator {
      text-align: center;
      position: absolute;
      top: 34em;
      width: 1000px;

      &__item {
        a {
          text-decoration: none;
        }
        cursor: pointer;
        &:hover {
          .navigator__name {
            visibility: initial;
            text-decoration: none;
          }
          .navigator__image {
            margin-top: -12px;
          }
        }
      }
      &__image {
        text-align: center;
        svg {
          width: 80px;
          height: 80px;
          path, circle {
            fill: $main-color;
          }
        }
      }

      &__name {
        text-decoration: none;
        visibility: hidden;
        display: block;
        margin: 16px 0;
        color: $main-color;
      }
    }

</style>
